[Function: buildAffiliateLink]
import type { Product } from "@/lib/types";

export const AMAZON_AFFILIATE_URL = "https://www.amazon.com/?tag=demoaffiliate-20";

export function buildAffiliateLink(product?: Product): string {
  if (!product) {
    return AMAZON_AFFILIATE_URL;
  }

  const separator = AMAZON_AFFILIATE_URL.includes("?") ? "&" : "?";
  const keyword = encodeURIComponent(product.title.slice(0, 80));

  return `${AMAZON_AFFILIATE_URL}${separator}k=${keyword}`;
}

