[Function: fetchJson]
import type { Category, Product } from "@/lib/types";

const API_BASE_URL = "https://fakestoreapi.com";
const REVALIDATE_SECONDS = 3600;

async function fetchJson<T>(path: string): Promise<T> {
  const response = await fetch(`${API_BASE_URL}${path}`, {
    next: { revalidate: REVALIDATE_SECONDS },
  });

  if (!response.ok) {
    throw new Error(`Fake Store API request failed: ${response.status}`);
  }

  return response.json() as Promise<T>;
}

export async function getProducts(): Promise<Product[]> {
  return fetchJson<Product[]>("/products");
}

export async function getProductById(id: number): Promise<Product> {
  return fetchJson<Product>(`/products/${id}`);
}

export async function getCategories(): Promise<Category[]> {
  return fetchJson<Category[]>("/products/categories");
}

export async function getProductsByCategory(category: string): Promise<Product[]> {
  const slug = encodeURIComponent(category);
  return fetchJson<Product[]>(`/products/category/${slug}`);
}

